tables.table_schema:
CREATE TABLE NutrientDeficiencies (
    id INT PRIMARY KEY,
    reported_symptoms VARCHAR,
    nutrient_deficiency VARCHAR
);

CREATE TABLE NutrientDeficiencySymptoms (
    id SERIAL PRIMARY KEY,
    symptom VARCHAR(255),
    nutrient VARCHAR(255)
);

CREATE TABLE ReportedSymptoms (
    id SERIAL PRIMARY KEY,
    user_id INT,
    symptom VARCHAR(255),
    reported_date TIMESTAMP
);

CREATE TABLE Symptoms (
  symptom_id INT PRIMARY KEY,
  symptom_name VARCHAR(50) NOT NULL,
  reported_date DATE
);

CREATE TABLE Nutrients (
  nutrient_id INT PRIMARY KEY,
  nutrient_name VARCHAR(50) NOT NULL,
  daily_requirement FLOAT
);

CREATE TABLE Deficiency (
  deficiency_id INT PRIMARY KEY,
  symptom_id INT REFERENCES Symptoms(symptom_id),
  nutrient_id INT REFERENCES Nutrients(nutrient_id),
  severity_level ENUM('Mild', 'Moderate', 'Severe')
);

CREATE TABLE NutrientDeficiencies (
  deficiency_id INT PRIMARY KEY,
  symptom VARCHAR(255) NOT NULL,
  nutrient_name VARCHAR(255) NOT NULL
);

CREATE TABLE Nutrients (
  nutrient_id INT PRIMARY KEY,
  nutrient_name VARCHAR(255) NOT NULL,
  daily_requirement FLOAT
);

CREATE TABLE Patients (
  patient_id INT PRIMARY KEY,
  patient_name VARCHAR(255) NOT NULL,
  age INT,
  gender CHAR(1)
);

CREATE TABLE Reports (
  report_id INT PRIMARY KEY,
  patient_id INT FOREIGN KEY REFERENCES Patients(patient_id),
  deficiency_id INT FOREIGN KEY REFERENCES NutrientDeficiencies(deficiency_id),
  report_date DATE
);

CREATE TABLE Symptoms (
  id INT PRIMARY KEY,
  symptom_name VARCHAR,
  description TEXT
);

CREATE TABLE NutrientLevels (
  id INT PRIMARY KEY,
  nutrient_name VARCHAR,
  level FLOAT
);

CREATE TABLE Deficiencies (
  id INT PRIMARY KEY,
  nutrient_id INT,
  symptom_id INT,
  severity VARCHAR
);

CREATE TABLE Users (
  id INT PRIMARY KEY,
  username VARCHAR,
  email VARCHAR
);

CREATE TABLE UserSymptoms (
  id INT PRIMARY KEY,
  user_id INT,
  symptom_id INT,
  reported_date TIMESTAMP
);
